m Vertrag endet, entfllt der Sicherungszweck und die Abtretung erlischt. Einer gesonderten Vereinbarung bedarf es sodann nicht mehr.<br>\r\n<p><strong></strong></p>\r\n<p><strong>6. Schlussbestimmungen</strong></p></br>\r\n(1) Smtliche Ansprche des Mandanten gegen den Makler aus diesem Vertrag knnen ohne schriftliche Zustimmung des Maklers nicht an Dritte abgetreten oder bertragen werden.<br><br>(2) Eine Aufrechnung gegen Ansprche aus diesem Vertrag ist ausgeschlossen, soweit die Ansprche bestritten bzw. nicht rechtskrftig festgestellt sind.<br><br>(3) Soweit der Mandant Kaufmann ist, ist ausschlielicher Gerichtsstand fr Auseinandersetzungen im Zusammenhang mit diesem Vertrag der Geschftssitz des Maklers.<br><br>(4) Nebenabreden zu diesem Vertrag sind nicht getroffen. Alle nderungen bedrfen zu ihrer Wirksamkeit der Schriftform. Gleiches gilt fr die Aufhebung des Schriftformerfordernisses.<br><br>(5) Sollten eine oder mehrere Bestimmungen dieses Vertrages unwirksam sein oder werden, bleibt die Wirksamkeit der brigen Bestimmungen unberhrt.<br>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><u>  </u> <u> </u></p>\r\n<p>Ort, Datum Unterschrift Mandant  Ort, Datum Unterschrift Makler</p>', 0, 0, 'bdc830a4207610e38f7d82e73bdb8b6d')
