rag ist nach  4 Abs. 11 UStG umsatzsteuerfrei.</div></br>(2) Der genannte Betrag ist wie folgt zu zahlen:\r\n\r\n\r\n<div id=\"partial_payment_with_increased_starting_produkt\">\r\n<p>- Teilzahlung mit erhhter Startzahlung</p>\r\n<p>Die Zahlung des Betrages wird dem Mandanten zinsfrei gestundet. Der Mandant leistet auf den in II. genannten Betrag eine Einmalzahlung in Hhe von <strong><span>100</span></strong> EUR. Der verbliebene Betrag in Hhe von <strong><span id=\"percentage_payment_produkt_content_value\">XXX</span></strong> EUR wird in <strong><span>444</span></strong> gleichen, monatlichen Raten zu jeweils <strong><span>100</span></strong> EUR, beginnend ab dem <strong><span>17-01-2020</span></strong>, gezahlt.</p>\r\n<p>Die Teil- bzw. Ratenzahlung stellt eine teilweise Stundung des jeweils noch ausstehenden Vergtungsbetrages aus dieser Vereinbarung. Bis zur nchsten Ratenflligkeit wird der noch ausstehende Zahlbetrag gestundet. Eine Darlehensgewhrung nach  491 ff. BGB an den Mandanten ist damit ausdrcklich nicht verbunden.</p>\r\n<p>Raten- bzw. Teilzahlungszuschlge werden nicht erhoben. Der effektive Jahreszins betrgt 0,00%, der zu leistende Gesamtbetrag entspricht in Summe dem unter II. genannten Betrag.</p>\r\n<p>Kommt der Mandant mit zwei aufeinanderfolgenden Zahlungen oder mit einer Gesamtsumme, die betragsmig der Summe zweier Raten entspricht, in Verzug, ist der sodann noch ausstehende Gesamtbetrag sofort zur Zahlung fllig.</p>\r\nDer genannte Betrag ist fllig mit der erfolgreichen Vermittlung des unter I. genannten Produkts. Die Vermittlung gilt als erfolgreich, wenn der Produktanbieter den Antrag des Mandanten angenommen hat, sptestens aber mit Entgegennahme der ersten Zahlung auf den vermittelten Vertrag und des Ablaufs eines gesetzlichen Widerrufs- bzw. Rcktrittsrechts, auf welches der Mandant vom Produktanbieter gesondert hingewiesen wird.\r\n</div>\r\n<p><br><strong xss=\"removed\">3. Vertragsabwicklung</strong></p></br>\r\n(1) Fr die Abwicklung dieses Vertrages nutzen die Parteien dipay, eine Onlineplattform zur Verwaltung und Abwicklung von Vergtungsvereinbarungen fr Makler.<br><br>(2) Der Makler stellt dem Mandanten einen Zugang zur Plattform zur Verfgung. Dem Mandanten werden im Rahmen des Registrierungsvorgangs die Nutzungsbedingungen der Plattform zugnglich gemacht.<br>\r\n<p><strong><br></strong><strong xss=\"removed\">4. Zahlungsabwicklung</strong></p></br>\r\n(1) Die Zahlung der vom Mandanten und Makler vereinbarten Vergtung erfolgt ber die vom Mandanten gewhlte Zahlungsart. Dem Mandanten stehen folgende Zahlungsarten zur Verfgung:\r\n<div id=\"bank_produkt\">\r\n<p>- berweisung</p>\r\n<p>(die nachfolgenden Punkte sind nur bei berweisung erforderlich)</p></br>\r\n(2) Der Mandant zahlt den vereinbarten Betrag nach Abschluss des Vertrages und Rechnungstellung innerhalb von 14 Tagen auf das Konto des Maklers.<br><br>(3) Wird der Betrag nicht innerhalb der genannten Frist gezahlt, kommt der Mandant mit seiner Leistung in Verzug. Sofern die Leistungspflicht nach dem Kalender bestimmt ist, bedarf es keiner Mahnung des Maklers. Im Falle des Verzugs gelten die gesetzlichen Regelungen zum Schuldnerverzug.<br><br>(4) Der Makler ist berechtigt, bis zum vollstndigen und vorbehaltslosen Ausgleich etwaiger offener Forderungen alle Leistungen aus diesem Vertrag einzustellen.<br>\r\n<p></p>\r\n</div>\r\n\r\n<p><br><strong xss=\"removed\">5. Absicherung der Ansprche des Maklers</strong></p></br>\r\n(1) Zur Sicherung der Zahlungsansprche des Maklers aus dieser Vereinbarung tritt der Mandant seine Ansprche aus dem unter Ziffer I genannten Vertrag an den Makler ab. Die Abtretung ist betragsmig auf Ansprche des Maklers aus dieser Vereinbarung beschrnkt.<br><br>(2) Der Makler nimmt die Abtretung an. Der Makler ist berechtigt, die Abtretung gegenber dem Produktanbieter offenzulegen. Der Mandant soll ber die Offenlegung der Abtretung in Textform informiert werden.<br><br>(3) Mit vollstndiger Erfllung der Zahlungspflichten des Mandanten aus diesem Vertrag endet, entfllt der Sicherungszweck und die Abtretung erlischt. Einer gesonderten Vereinbarung bedarf es sodann nicht mehr.<br>\r\n<p><strong></strong></p>\r\n<p><strong>6. Schlussbestimmungen</strong></p></br>\r\n(1) Smtliche Ansprche des Mandanten gegen den Makler aus diesem Vertrag knnen ohne schriftliche Zustimmung des Maklers nicht an Dritte abgetreten oder bertragen werden.<br><br>(2) Eine Aufrechnung gegen Ansprche aus diesem Vertrag ist ausgeschlossen, soweit die Ansprche bestritten bzw. nicht rechtskrftig festgestellt sind.<br><br>(3) Soweit der Mandant Kaufmann ist, ist ausschlielicher Gerichtsstand fr Auseinandersetzungen im Zusammenhang mit diesem Vertrag der Geschftssitz des Maklers.<br><br>(4) Nebenabreden zu diesem Vertrag sind nicht getroffen. Alle nderungen bedrfen zu ihrer Wirksamkeit der Schriftform. Gleiches gilt fr die Aufhebung des Schriftformerfordernisses.<br><br>(5) Sollten eine oder mehrere Bestimmungen dieses Vertrages unwirksam sein oder werden, bleibt die Wirksamkeit der brigen Bestimmungen unberhrt.<br>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><u>  </u> <u> </u></p>\r\n<p>Ort, Datum Unterschrift Mandant  Ort, Datum Unterschrift Makler</p>', 0, 0, '028bba9ffdbc80ad9fb380ccd57e069a')
